def createnamehash(PATH,diff):
    conn = sqlite3.connect(PATH)
    cursor = conn.cursor()
    sql = "SELECT title,level,hash FROM Charts"
    cursor.execute(sql)
    hold = cursor.fetchall()
    answer = {}
    for i in hold:
        if i[1] == diff:
            answer.update({i[0]:i[2]})
